import * as React from "react";
import axios from "axios";
import Deleteimg from "../../../../asset/images/Deleteimg.png";
import Button from "@mui/material/Button";
import Dialog from "@mui/material/Dialog";
import DialogActions from "@mui/material/DialogActions";
import DialogContent from "@mui/material/DialogContent";
import DialogContentText from "@mui/material/DialogContentText";
import DialogTitle from "@mui/material/DialogTitle";

export default function Delete(name) {
  const [data, setData] = React.useState([]);
  const [open, setOpen] = React.useState(false);

  const handleClickOpen = () => {
    setOpen(true);
  };

  const handleClose = () => {
    setOpen(false);
  };
  const handleDeleteList = (id) => {
    console.log(id);
    axios.delete(`http://localhost:3000/data1/${id}`).then((res) => {
      console.log(res);
      console.log(res.data);
      setData(data.filter((item) => item.id !== id));
      console.log(id);
      setOpen(false);
    });
  };

  return (
    <div>
      <Button variant="outlined" onClick={handleClickOpen}>
        Delete
      </Button>
      <Dialog
        open={open}
        onClose={handleClose}
        aria-labelledby="alert-dialog-title"
        aria-describedby="alert-dialog-description"
      >
        <DialogTitle id="alert-dialog-title">
          <img
            style={{ height: "200px", marginLeft: "60px" }}
            src={`${Deleteimg}`}
          />
        </DialogTitle>

        <DialogContent sx={{ width: "400px", textAlign: "center" }}>
          <DialogContentText id="alert-dialog-description">
            <b style={{ fontSize: "30px" }}>Are you sure?</b>
            <p>Delete project: {data}?</p>
          </DialogContentText>
        </DialogContent>
        <DialogActions>
          <Button onClick={handleClose}>No</Button>
          <Button onClick={() => handleDeleteList(name)} autoFocus>
            Yes
          </Button>
        </DialogActions>
      </Dialog>
    </div>
  );
}
